import React from 'react'
import Video  from "./Video";
const VideoGrid = () => {
    const images = [1,2,3,4,5,6,7,8];

    return (
        <div className="music-grid">
            {images.map(img => (
                <Video key={img} video={img} />
            ))}
        </div>
    )
}

export default VideoGrid
